window.bookSummaryJSON = "<p>Working as a journalist at a small weekly paper in rural Idaho, Cal Murphy begins losing his big city dreams of writing for a metro paper. His passion is reignited after three high school star athletes are found dead in a 24-hour period. As he and fellow photographer Kelly Mendoza attempt to make sense of bizarre circumstances that led to the teens' deaths, Cal makes a chilling discovery, uncovering a vast conspiracy that grows darker with every twist and turn. </p> <p>With a mastermind determined to silence Cal and Kelly for good, the young reporters ultimately must decide if their lives are worth the risk to reveal the truth.</p>"; 
